import React from 'react';
import { Grid, Typography} from '@material-ui/core';
import Avatar from '@mui/material/Avatar';

const AvatarUserTime: React.FC =() => {
    return (
        <Grid container direction='row' spacing ={5}>
            <Grid item >
                <Avatar variant='rounded' sx={{ width: 70, height: 70 }}>J</Avatar>
            </Grid>
            <Grid item direction='column'>
                <Typography align='left' variant='h5'>John</Typography>
                <Typography align='left' variant='subtitle1' color='textSecondary'>6h ago</Typography>
            </Grid>
        </Grid>
    );
};

export default AvatarUserTime;
